import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';



const rootElement = document.getElementById("root");
render(
    <BrowserRouter>
        <Routes>
        <Route path="/" element = {<App />}>
            <Route path="home" element = {<Home />} />
            <Route path="summoner" element = {<Summoner />}/>
        </Route>
        </Routes>
    </BrowserRouter>,
    rootElement
  );
